template <typename T>void loadWeights8(wstring &input16, T *output, int size){
 unsigned int i = 0;
  unsigned int code = 0;
 uint8_t byteValue = 0;
 int8_t cvtbyte = 0;
 int pos = 0;
 int cpt = 0;
 while (size-- > 0) {
 if (((1 << i) & 0x2b) != 0) {
 code = input16[pos++] - 0x5000;
 }
 switch (i % 7) {
 case 0: byteValue = code >> 6;
 memcpy(&cvtbyte, &byteValue, 1);
 output[cpt++] = cvtbyte;
 byteValue = (code & 0x3f) << 2;
 break;
 case 1: byteValue |= code >> 12;
 memcpy(&cvtbyte, &byteValue, 1);
 output[cpt++] = cvtbyte;
 break;
 case 2: byteValue = (code >> 4) & 0xff;
 memcpy(&cvtbyte, &byteValue, 1);
 output[cpt++] = cvtbyte;
 byteValue = (code & 0xf) << 4;
 break;
 case 3: byteValue |= code >> 10;
 memcpy(&cvtbyte, &byteValue, 1);
 output[cpt++] = cvtbyte;
 break;
 case 4: byteValue = (code >> 2) & 0xff;
 memcpy(&cvtbyte, &byteValue, 1);
 output[cpt++] = cvtbyte;
 byteValue = (code & 3) << 6;
 break;
 case 5: byteValue |= code >> 8;
 memcpy(&cvtbyte, &byteValue, 1);
 output[cpt++] = cvtbyte;
 break;
 case 6: byteValue = code & 0xff;
 memcpy(&cvtbyte, &byteValue, 1);
 output[cpt++] = cvtbyte;
 break;
 }
   if (++i == 7) i = 0;
 }
}
void loadWeights(wstring &input16, int8_t *output, int size, float factor = 1.0f){
 string input;
 for (auto &c : input16) {
 input += (char)(c >> 8);
 input += (char)(c & 255);
 }
 stringstream ss(input);
 for (int i = 0;
 i < size;
 i++) {
 char s1, s2;
 ss.get(s1);
 ss.get(s2);
 int32_t s = (uint8_t)s2 + (((uint8_t)s1) << 8)-5000-20480;
 output[i] = (64.0f/256.0f) * (float(s));
 }
}
void loadbias(wstring &input16, int32_t *output, int size, float factor = 1.0f){
 string input;
 for (auto &c : input16) {
 input += (char)(c >> 8);
 input += (char)(c & 255);
 }
 stringstream ss(input);
 for (int i = 0;
 i < size;
 i++) {
 char s1, s2;
 ss.get(s1);
 ss.get(s2);
 int32_t s = (uint8_t)s2 + (((uint8_t)s1) << 8)-5000-20480;
 output[i] = 127.0f * 64.0f/(256.0f) * (float(s));
 }
}
void loadWeights16(wstring &input16, int16_t *output, int size){
 string input;
 for (auto &c : input16) {
 input += (char)(c >> 8);
 input += (char)(c & 255);
 }
 stringstream ss(input);
 for (int i = 0;
 i < size;
 i++) {
 char s1, s2;
 ss.get(s1);
 ss.get(s2);
 int32_t s = (uint8_t)s2 + (((uint8_t)s1) << 8)-5000-20480;
 output[i] = 127.0f/256.0f*float(s);
 }
}
