void ModelWeights::load_weights(){
 loadWeights8<int16_t>(w0, W0, ACC_SIZE * 128);
 loadWeights16(b0, B0, ACC_SIZE);
 loadWeights8<int8_t>(w1, W1, ACC_SIZE * 32);
 loadbias(b1, B1, 32);
 loadWeights8<int8_t>(w2, W2, 32 * 32);
 loadbias(b2, B2, 32);
 loadWeights(w3, W3, 32);
 loadbias(b3, B3, 1);
}
