void crelu16(int size, int8_t *output, const int16_t *input){
 constexpr int in_register_width = 256 / 16;
 constexpr int out_register_width = 256 / 8;
 const int num_out_chunks = size / out_register_width;
 const __m256i zero = _mm256_setzero_si256();
 const int control = 0b11011000;
 for (int i = 0;
 i < num_out_chunks;
 ++i) {
 const __m256i in0 = _mm256_loadu_si256((__m256i *)&input[(i * 2 + 0) * in_register_width]);
 const __m256i in1 = _mm256_loadu_si256((__m256i *)&input[(i * 2 + 1) * in_register_width]);
 const __m256i result = _mm256_permute4x64_epi64( _mm256_max_epi8( _mm256_packs_epi16(in0, in1), zero), control);
 _mm256_storeu_si256((__m256i *)&output[i * out_register_width], result);
 }
 return;
}
void crelu32(int size, int8_t *output, const int32_t *input){
 constexpr int in_register_width = 256 / 32;
 constexpr int out_register_width = 256 / 8;
 const int num_out_chunks = size / out_register_width;
 const __m256i zero = _mm256_setzero_si256();
 const __m256i control = _mm256_set_epi32(7, 3, 6, 2, 5, 1, 4, 0);
 for (int i = 0;
 i < num_out_chunks;
 ++i) {
 const __m256i in0 = _mm256_packs_epi32(_mm256_loadu_si256((__m256i *)&input[(i * 4 + 0) * in_register_width]), _mm256_loadu_si256((__m256i *)&input[(i * 4 + 1) * in_register_width]));
 const __m256i in1 = _mm256_packs_epi32(_mm256_loadu_si256((__m256i *)&input[(i * 4 + 2) * in_register_width]), _mm256_loadu_si256((__m256i *)&input[(i * 4 + 3) * in_register_width]));
 const __m256i result = _mm256_permutevar8x32_epi32(_mm256_max_epi8(_mm256_packs_epi16(in0, in1), zero), control);
 _mm256_storeu_si256((__m256i *)&output[i * out_register_width], result);
 }
 return;
}
