int bestaction(const Board &game, unordered_map<Board, StateInfo> &T){
 int kbest = 0;
 int k = 0;
 SV bestsvalue = T.at(game).actions[0];
 for (const auto &action : T[game].actions) {
 if (bestsvalue <= action) {
 bestsvalue = action;
 kbest = k;
 }
 k++;
 }
 return kbest;
}
int bestaction_final(Board game, unordered_map<Board, StateInfo> &T){
 int kbest = 0;
 int k = 0;
 SV bestsvalue = T[game].actions[0];
  for (const auto &action : T[game].actions) {
 if (bestsvalue.solved < action.solved) {
 bestsvalue = action;
 kbest = k;
 }
 else if (bestsvalue.solved == action.solved && bestsvalue.n < action.n) {
 bestsvalue = action;
 kbest = k;
 }
 else if (bestsvalue.solved == action.solved && bestsvalue.n == action.n && bestsvalue.value < action.value) {
 bestsvalue = action;
 kbest = k;
 }
 ++k;
 }
 return kbest;
}
void update(Board game, unordered_map<Board, StateInfo> &T){
 int k = bestaction(game, T);
 T[game].value.solved = T[game].actions[k].solved;
 T[game].value.value = T[game].actions[k].value;
 if (T[game].value.solved != 0) T[game].value.resolved = 1;
 else {
 int8_t resolved = 1;
 for (const auto &action : T[game].actions) {
 resolved &= action.resolved;
 if (resolved == 0) break;
 }
 T[game].value.resolved = resolved;
 }
}
